package service;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.*;

import entite.ImageA;
import entite.Personne;
import javafx.scene.image.Image;

public class Modele {
	
	public Modele() {
		
		dictImage.put("Castres", castres);
		dictImage.put("Toulouse", toulouse);
		dictImage.put("Marseille", marseille);
		dictImage.put("Paris", paris);
		
	}
	
	private ImageA castres = new ImageA("Castres","data:image/jpeg;base64,");
	private ImageA toulouse = new ImageA("Toulouse","data:image/jpeg;base64,");
	private ImageA marseille = new ImageA("Marseille","data:image/jpeg;base64,");
	private ImageA paris = new ImageA("Paris","data:image/jpeg;base64,");
	
	HashMap<String, ImageA> dictImage = new HashMap<String, ImageA>();
	
	private Personne Jean = new Personne("Jean","popo");
	private Personne Pierre = new Personne("Pierre","popo");
	private Personne Pablo = new Personne("Pablo","popo");
	private Personne George = new Personne("George","popo");
	
	HashMap<String,String> dictPersonne = new HashMap<String,String>();

	public HashMap<String, ImageA> getDictImage() {
		System.out.println(dictImage);
		return dictImage;
	}
	
	public HashMap getDictPersonne() {
		return dictPersonne;
	}

	public Image getImageVille(String nom) {
		String url = this.dictImage.get(nom).getUrlImage();
		Image imageVille = new Image(url);
		return imageVille;
	}
	
	public String getNomPersonne(String nomPersonne) {
		String nomP = this.dictPersonne.get(nomPersonne);
		System.out.println(nomP);
		return nomP;
	}
	
}
